import './checkout.scss'
import { CartContext } from '../../context/cart-context.context';
import { useContext } from 'react';

const Checkout = () => {
    const {cartitems} = useContext(CartContext);
    return(
        <div>
            checkout page
            <div>
                {
                    cartitems.map((item)=>(
                        <div key={item.id}></div>
                    ))
                }
            </div>
        </div>
    )
}

export default Checkout;
